öncelikle;

(bkz: bok mu lan o)

başlıkta "arap" şeklinde yazmasa bile kimin bindiği rahatlıkla anlaşılabilecek uçaktır. kendi töresini, yaşayışını, binlerce yıllık adetlerini, dilini, yazısını, inancını bırakıp bu zibidilerin büzükdaşı olan bilumum tarihi şahsiyetin, devlet adamının, sülale reisinin, kendine bay-kağan-hakan-sultan diyen zibidilerin sıfatına tükürmek gerekir.
